import React, { Component } from 'react';
import Navigationbar from '../navigation';
import '@fortawesome/fontawesome-free/css/all.min.css';
import PropTypes from 'prop-types';
// import { connect } from 'react-redux';
// import { customerSignup } from '../../actions/signupActions'
import { Redirect } from 'react-router';
import { Link } from 'react-router-dom';
import { Jumbotron, CardImg} from 'react-bootstrap';
import YelpImage from './../images/yelp_logo.jpg'
import axios from 'axios';

class userProfile extends Component {
    constructor(props) {
        super(props);
        this.state= {}
    }

    render() {
        return (
        <div>
            <Navigationbar />
            <div class='jumbotron'>
            <Jumbotron>
          <div class='row'>
            <div class=' col-md-2 card profilePic'>
              <label for='profileImage'>
                <a
                  class='btn btn-secondary btn-sm btn-rounded'
                  style={{ marginLeft: '10px', marginTop: '10px' }}>
                  <i class='fas fa-camera' style={{ marginRight: '10px' }}></i>
                  Add a photo
                </a>
              </label>
              <input
                type='file'
                name='profileImage'
                id='profileImage'
                style={{ display: 'none' }}
                value=''
                onChange={this.changeProfileImage}></input>
              <card>
                <CardImg
                  variant='top'
                  src={YelpImage}
                  className='profileImg'
                />
              </card>
            </div>
            <div class='col-md-4 profileName'>
              <h1>Rakshitha Sathyakumar</h1>
              <h4>rakshu595@gmail.com</h4>
            </div>

            <div class='col-md-4 vertical-divider'>
              <ul class='list-unstyled'>
                <li>
                  <a href='#'>
                    <span>
                      <i class='fas fa-camera'></i>{' '}
                    </span>
                    Add Profile Photo
                  </a>
                </li>
                <li>
                  <a href='#'>
                    <span>
                      <i class='fas fa-id-card'></i>{' '}
                    </span>
                    Update your profile
                  </a>
                </li>
              </ul>
            </div>
          </div>
        </Jumbotron>
    </div>
    </div>
    )}
}

export default userProfile;
